import React, { useEffect ,useState } from 'react';

import PropTypes from "prop-types";
import './graphh.css';
import { format } from "d3-format";
import {
    OHLCTooltip,
	SingleValueTooltip,
    
} from "react-stockcharts/lib/tooltip";
import { scaleTime } from "d3-scale";
import { utcDay } from "d3-time";
import { utcHour  } from "d3-time";
import { ChartCanvas, Chart } from "react-stockcharts";
import { CandlestickSeries ,LineSeries ,} from "react-stockcharts/lib/series";
import { XAxis, YAxis } from "react-stockcharts/lib/axes";
import { fitWidth } from "react-stockcharts/lib/helper";
import { last, timeIntervalBarWidth } from "react-stockcharts/lib/utils";
import { withRouter } from 'react-router-dom';
import { timeFormat } from "d3-time-format";
import {

    Link
  } from "react-router-dom";
import {
    CrossHairCursor,
    EdgeIndicator,
    CurrentCoordinate,
    MouseCoordinateX,
    MouseCoordinateY
} from "react-stockcharts/lib/coordinates";
import {
    Label,
    Annotate,
    SvgPathAnnotation,
    buyPath,
    sellPath,
  } from "react-stockcharts/lib/annotation";

function Graphh(props) {
    const  [display1, setDisplay1] = useState();
    const  [display2, setDisplay2] = useState();
    const  [display3, setDisplay3] = useState();
    const  [display4, setDisplay4] = useState();
    const  [display5, setDisplay5] = useState();
    const  [display6, setDisplay6] = useState();
    const  [display7, setDisplay7] = useState();
    const  [display8, setDisplay8] = useState();
    const  [display9, setDisplay9] = useState();
    const  [display10, setDisplay10] = useState();
    const  [display11, setDisplay11] = useState();
    const  [display12, setDisplay12] = useState();
    const  [display13, setDisplay13] = useState();
    const  [display14, setDisplay14] = useState();
    const  [display15, setDisplay15] = useState();
    const  [handleDownloadMore, sethandleDownloadMore] = useState();
    const [data, setData] = useState([]);
    const [width,setWidth] =useState()
    
    const [loading ,setLoding] = useState(false)
    const [price ,setPrice] = useState(0)
   
     
   
    useEffect(()=>{
        loopData(props.data.data.hcl);
       
    },[props.data])
    
    const loopData = (hcl) => {
        
        var array = [];
        var OpenLen = hcl.Open.length;
        //props.data.data.
        for( var i = 0; i < OpenLen; i++){
            
            array.push({ date: new Date(hcl.opentime[i]),  open : hcl.Open[i], high: hcl.High[i], low : hcl.Low[i],close: hcl.Close[i],volume : hcl.Volume[i],buy2: props.data.data.ai.bigmome.BUY2[i],ambi: props.data.data.ai.bigmome.ambi[i]  ,amb0: props.data.data.ai.sell.amb0[i],amb1: props.data.data.ai.sell.amb1[i],amb2: props.data.data.ai.sell.amb2[i],amb3: props.data.data.ai.sell.amb3[i],amb99: props.data.data.ai.sell.amb99[i],amb13: props.data.data.ai.mome.amb13[i],amb14: props.data.data.ai.mome.amb14[i],
                amb15: props.data.data.ai.mome.amb15[i],amb55: props.data.data.ai.mome.amb55[i],ci: props.data.data.ai.smallmome.ci[i],amo: props.data.data.ai.smallmome.amo[i],
                ambb: props.data.data.ai.buy.ambb[i],rsik: props.data.data.formula.rsiK[i],ambb5: props.data.data.ai.buy.ambb5[i],ww6: props.data.data.ai.buy.ww6[i],ww7: props.data.data.ai.buy.ww7[i] ,BUYSELL :props.data.data.ai.other.BUYSELL[i] })
        }
        setData(array)
        setWidth(window.innerWidth)
        setLoding(true)
        setPrice(props.data.data.hcl.Close[0])
       
        
    }
 
    const longAnnotationProps = {
		
			y: ({ yScale, datum }) => yScale(datum.low),
			fill: "#006517",
			path: buyPath,
			tooltip: "Go long",
		};
    const shortAnnotationProps = {
			y: ({ yScale, datum }) => yScale(datum.high),
			fill: "#FF0000",
			path: sellPath,
			tooltip: "Go short",
		};
    const margin = { left: 70, right: 70, top: 20, bottom: 30 };

    const height = 400;
    const gridHeight = height - margin.top - margin.bottom;
    const gridWidth = width - margin.left - margin.right;
    const showGrid = true;
    const yGrid = showGrid
    ? { innerTickSize: -1 * gridWidth, tickStrokeOpacity: 0.2 }
    : {};
  const xGrid = showGrid
    ? {  innerTickSize: -2 * gridHeight,
      tickStrokeDasharray: 'Solid',
      tickStrokeOpacity: 0.2,
      tickStrokeWidth: 1 }
    : {};

    window.addEventListener("resize", function() {
        setWidth(window.innerWidth)
        
    });
    window.addEventListener("resize", function() {
      setWidth(window.innerWidth)
  });
    // console.log(new Date(props.data.data.hcl.opentime[0]))
  
    const xAccessor = (d) => {
        if (d != null){
          
            return d.date
        }
      }
  
    const xExtents = [
        xAccessor(last(data)),
        xAccessor(data[data.length - 150])
    ];

    return (
     

        <div  style={{
          height:"105vh",
          maxHeight: '50%',
       
          
        }}  >
       	   {loading && data!==null ? <ChartCanvas  className ="aa"   height={945}
                     margin={{left: 80, right: 100, top:10, bottom: 30}}
					width={width}
                    onChange={"resize"}
                    ratio ={true}
					type={"svg"}
					seriesName="MSFT"
					data={data}
					xAccessor={d =>  d.date}
					xScale={scaleTime(Date.now())}
					xExtents={xExtents}
                       
                    >

				<Chart height={150} id={0} yExtents={d => [d.high, d.low]}
                 padding={{ top: 10, bottom: 10 }}>
                 
        
					<YAxis axisAt="right" orient="right" ticks={7}  {...yGrid}/>
             <Annotate with={SvgPathAnnotation} when={d => d.BUYSELL === 1}
						usingProps={longAnnotationProps} />
            <Annotate with={SvgPathAnnotation} when={d => d.BUYSELL === 2}
						usingProps={shortAnnotationProps} />   
       	<XAxis  showGrid={true} axisAt="bottom" orient="bottom"
           opacity={2}
           showTicks={false}/>
			  
                    
					<CandlestickSeries width={timeIntervalBarWidth(utcHour.every(4))}/>
          <OHLCTooltip origin={[-40, 8]} />
          { price>1000 || price<0.01  ?   <EdgeIndicator   itemType="last" orient="right" edgeAt="right"
        yAccessor={d => d.close}  fill={(d) => (d.close > d.open ? "#6BA583" : "#FF0000")} displayFormat={format(".4s")} />
          : <EdgeIndicator   itemType="last" orient="right" edgeAt="right"
        yAccessor={d => d.close}  fill={(d) => (d.close > d.open ? "#6BA583" : "#FF0000")}  />
           }

     
				</Chart>
                
     
        <Chart
          id={1}
          yExtents={d =>  d.ambi }
          height={75}
  
          origin={(w, h) => [0, h - 740 ]}
          padding={{ top: 10, bottom: 10 }}
          
        >
         
          <YAxis axisAt="right" orient="right" ticks={3} {...yGrid} />
    
          <LineSeries yAccessor={d =>  d.buy2} stroke = {"#283747"} style={ display1 ? {display: "none"}:{display: ""}}/>
          <LineSeries yAccessor={d =>  d.ambi} stroke = {"#657a00"} style={ display2 ? {display: "none"}:{display: ""}} />
          <CurrentCoordinate
        yAccessor={d =>  d.buy2}    fill= { !display1 ? "#283747":"#FFFFFF"}
          />
             <CurrentCoordinate
            yAccessor={d =>  d.ambi}  fill= { !display2 ? "#657a00":"#FFFFFF"}
          />
         <SingleValueTooltip
                   onClick={() => setDisplay1(!display1) }
                  yAccessor={d =>  d.buy2}
                  yLabel={`BUY2`}
                  yDisplayFormat={format(".2f")}

                  
                  origin={[-40, 3]}/>
         
              <SingleValueTooltip
                        onClick={() => setDisplay2(!display2) }
						yAccessor={d =>  d.ambi}
						yLabel={`ambi`}
						yDisplayFormat={format(".2f")}
								
                      
						origin={[30, 3]}/>
                               <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            opacity={2}
          />
                  <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={2}
          yExtents={d =>  d.amb0 }
          height={90}
  
          origin={(w, h) => [0, h - 650 ]}
          padding={{ top: 15, bottom: 15 }}
        >
       
          <YAxis axisAt="right" orient="right" ticks={3}{...yGrid} />
    
          <LineSeries yAccessor={d =>  d.amb0} stroke = {"#283747"} style={ display3 ? {display: "none"}:{display: ""}}  />
          <LineSeries yAccessor={d =>  d.amb1} stroke = {"#657a00"} style={ display4 ? {display: "none"}:{display: ""}} />
          <LineSeries yAccessor={d =>  d.amb2} stroke = {"#FF4136"}  style={ display5 ? {display: "none"}:{display: ""}}/>
          <LineSeries yAccessor={d =>  d.amb3} stroke = {"#7FDBFF"}  style={ display6 ? {display: "none"}:{display: ""}}/>
          <LineSeries yAccessor={d =>  d.amb99} stroke = {"#B10DC9"}  style={ display7 ? {display: "none"}:{display: ""}}/>
          <SingleValueTooltip
						yAccessor={d =>  d.amb0}
                        onClick={() => setDisplay3(!display3) }
						yLabel={`amb0`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
                        onClick={() => setDisplay4(!display4) }
						yAccessor={d =>  d.amb1}
						yLabel={`amb1`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4684" - optional prop */
						origin={[30, 3]}/>
                          <SingleValueTooltip
                          onClick={() => setDisplay5(!display5) }
						yAccessor={d =>  d.amb2}
						yLabel={`amb2`}
						yDisplayFormat={format(".2f")}
						valueStroke={{strocke :"#B10DC9"}} 
						labelStroke="#B10DC9"
						origin={[100, 3]}/>
                          <SingleValueTooltip
                          onClick={() => setDisplay6(!display6) }
						yAccessor={d =>  d.amb3}
						yLabel={`amb3`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[170, 3]}/>
                          <SingleValueTooltip
                          onClick={() => setDisplay7(!display7) }
						yAccessor={d =>  d.amb99}
						yLabel={`amb99`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[240, 3]}/>
                                  <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            
            opacity={2}
          />
             <CurrentCoordinate
            yAccessor={d =>  d.amb99}     fill= { !display7 ? "#B10DC9":"#FFFFFF"}
          />
                 <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
           
        </Chart>
        <Chart
          id={3}
          yExtents={d =>  d.amb13 }
          height={100}
  
          origin={(w, h) => [0, h - 545 ]}
          padding={{ top: 15, bottom: 10 }}
        >
          
          <YAxis axisAt="right" orient="right" ticks={3} {...yGrid} />
    
          <LineSeries yAccessor={d =>  d.amb13} stroke = {"#283747"} style={ display8 ? {display: "none"}:{display: ""}} />
          <LineSeries yAccessor={d =>  d.amb14} stroke = {"#657a00"}  style={ display9 ? {display: "none"}:{display: ""}}/>
          <LineSeries yAccessor={d =>  d.amb15} stroke = {"#FF4136"} style={ display10 ? {display: "none"}:{display: ""}} />
          <LineSeries yAccessor={d =>  d.amb55} stroke = {"#7FDBFF"} style={ display11 ? {display: "none"}:{display: ""}} />
          
          <SingleValueTooltip
            onClick={() => setDisplay8(!display8) }
						yAccessor={d =>  d.amb13}
						yLabel={`amb13`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
              <SingleValueTooltip
                        onClick={() => setDisplay9(!display9) }
						yAccessor={d =>  d.amb14}
						yLabel={`amb14`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
                          <SingleValueTooltip
                          onClick={() => setDisplay10(!display10) }
						yAccessor={d =>  d.amb15}
						yLabel={`amb15`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
                          <SingleValueTooltip
                        onClick={() => setDisplay11(!display11) }
						yAccessor={d =>  d.amb55}
						yLabel={`amb55`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[170, 3]}/>
                            <CurrentCoordinate
           yAccessor={d =>  d.amb13}  fill = { !display8 ? "#283747":"#FFFFFF"}
          />
                          <CurrentCoordinate
           yAccessor={d =>  d.amb14}   fill= { !display9 ? "#657a00":"#FFFFFF"}
          />
                                                      <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
     
            opacity={2}
          />
                   <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={4}
          yExtents={d =>  d.ambb }
          height={100}
  
          origin={(w, h) => [0, h - 425 ]}
          padding={{ top: 10, bottom: 10 }}
        >
         
          <YAxis axisAt="right" orient="right" ticks={2} {...yGrid} />
    
         
          <LineSeries yAccessor={d =>  d.amo} stroke = {"#657a00"} style={ display13 ? {display: "none"}:{display: ""}}  />
          <LineSeries yAccessor={d =>  d.ambb} stroke = {"#FF4136"}  style={ display14 ? {display: "none"}:{display: ""}} />
  
          
    
              <SingleValueTooltip
                        onClick={() => setDisplay13(!display13) }
						yAccessor={d =>  d.amo}
						yLabel={`amo`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
                    <SingleValueTooltip
                        onClick={() => setDisplay14(!display14) }
						yAccessor={d =>  d.ambb}
						yLabel={`ambb`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[100, 3]}/>
                  
    
            <XAxis
            axisAt="bottom"
            orient="bottom"
            showTicks={false}
            opacity={2}
          />
                  <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
        <Chart
          id={5}
          yExtents={d =>  d.ambb5 }
          height={100}
  
          origin={(w, h) => [0, h - 310 ]}
          padding={{ top: 10, bottom: 10 }}
        >
         
          <YAxis axisAt="right" orient="right" ticks={3} {...yGrid}  />
    
          <LineSeries yAccessor={d =>  d.ambb5} stroke = {"#283747"} style={ display15 ? {display: "none"}:{display: ""}}  />
          <LineSeries yAccessor={d =>  d.ci} stroke = {"#657a00"} style={ display12 ? {display: "none"}:{display: ""}}  />
          
          <SingleValueTooltip
            onClick={() => setDisplay15(!display15) }
						yAccessor={d => d.ambb5}
						yLabel={`ambb5`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[-40, 3]}/>
           <SingleValueTooltip
                        onClick={() => setDisplay12(!display12) }
						yAccessor={d =>  d.ci}
						yLabel={`ci`}
						yDisplayFormat={format(".2f")}
						/* valueStroke={atr14.stroke()} - optional prop */
						/* labelStroke="#4682B4" - optional prop */
						origin={[30, 3]}/>
                                   <CurrentCoordinate
           yAccessor={d =>  d.ambb5}  fill= { !display15 ? "#283747":"#FFFFFF"}
          />
          
            <XAxis axisAt="bottom" orient="bottom" 	outerTickSize={10}         {...xGrid} />
            <MouseCoordinateX
            at="bottom"
            orient="bottom"
            opacity={2}
            displayFormat={timeFormat("%Y-%m-%d")}
          />
          <MouseCoordinateY
            at="right"
            orient="right"
            displayFormat={format(".2f")}
          />
        </Chart>
          <CrossHairCursor />
			</ChartCanvas> : ""}
        </div>
    )
}

export default Graphh
